                                f_last_modify_time datetime,
                                f_last_modify_user_id nvarchar(50),
                                f_delete_time datetime,
                                f_delete_user_id nvarchar(50),
                                f_delete_mark int,
                                f_tenant_id nvarchar(50) NOT NULL

    , PRIMARY KEY (f_id,f_tenant_id)
);
